import React from 'react';
import Menu from './componentes/menu';
import Jumbo from './componentes/jumbo';
import Car from './componentes/carousel';
import Form from './componentes/form';

function App() {
  return (
    <>
        < Menu />
        < Jumbo />
        < Car />
        < Form />
    </>
  );
}

export default App;
